
-- SQL commands to create and populate the tables
-- Vehicles Table
DROP TABLE IF EXISTS Vehicles;
CREATE TABLE Vehicles (
    VehicleID VARCHAR(10) PRIMARY KEY,
    VehicleType VARCHAR(20),
    RegistrationDate DATE,
    Manufacturer VARCHAR(50),
    ModelYear INT
);

-- Roads Table
DROP TABLE IF EXISTS Roads;
CREATE TABLE Roads (
    RoadID VARCHAR(10) PRIMARY KEY,
    RoadName VARCHAR(100),
    Length_km FLOAT,
    RoadType VARCHAR(50),
    Condition1 VARCHAR(50)
);

-- Traffic Lights Table
DROP TABLE IF EXISTS TrafficLights;
CREATE TABLE TrafficLights (
    LightID VARCHAR(10) PRIMARY KEY,
    RoadID VARCHAR(10),
    Location VARCHAR(100),
    InstallDate DATE
);

ALTER TABLE TrafficLights
ADD COLUMN TrafficLightStatus VARCHAR(20); -- You can adjust the data type and length as needed


-- Traffic Data Table
DROP TABLE IF EXISTS TrafficData;
CREATE TABLE TrafficData (
    DataID INT PRIMARY KEY,
    RoadID VARCHAR(10),
    DateTime DATETIME,
    TrafficVolume INT,
    AverageSpeed_km_h INT
);

-- Accident Reports Table
DROP TABLE IF EXISTS AccidentReports;
CREATE TABLE AccidentReports (
    ReportID VARCHAR(10) PRIMARY KEY,
    Date DATE,
    Time TIME,
    RoadID VARCHAR(10),
    Severity VARCHAR(50),
    Description TEXT
);


CREATE TABLE TrafficFlow (
    DataID VARCHAR(10) PRIMARY KEY,
    RoadID VARCHAR(10),
    Date DATE,
    Time TIME,
    VehicleCount INT,
    AverageSpeed FLOAT
);

CREATE TABLE TrafficLightControl (
    ControlID INT AUTO_INCREMENT PRIMARY KEY,
    RoadID VARCHAR(10),
    LightStatus VARCHAR(20),
    ControlTimestamp DATETIME
);






-- Check for missing values
SELECT *
FROM Vehicles
WHERE VehicleID IS NULL
   OR VehicleType IS NULL
   OR RegistrationDate IS NULL
   OR Manufacturer IS NULL
   OR ModelYear IS NULL;

-- Check for invalid data types
-- Check for invalid date values in RegistrationDate
SELECT *
FROM Vehicles
WHERE STR_TO_DATE(RegistrationDate, '%Y-%m-%d') IS NULL;

-- Remove duplicate entries based on VehicleID, keeping the one with the lowest RowID
DELETE v1
FROM Vehicles v1
JOIN Vehicles v2
   ON v1.VehicleID = v2.VehicleID
   AND v1.VehicleID > v2.VehicleID;
   
   -- Check for missing values
