-- Analyze traffic flow data to identify congestion-prone areas and times
SELECT RoadID, AVG(VehicleCount) AS AvgVehicleCount
FROM TrafficFlow
GROUP BY RoadID
HAVING AVG(VehicleCount) > 100;

-- Prioritize roads for maintenance based on condition and traffic volume
SELECT r.RoadID, r.Condition1, AVG(tf.VehicleCount) AS AvgTrafficVolume
FROM Roads r
JOIN TrafficFlow tf ON r.RoadID = tf.RoadID
GROUP BY r.RoadID, r.Condition1
ORDER BY r.Condition1 DESC, AvgTrafficVolume DESC;


-- Analyze accident data to identify high-risk areas
SELECT RoadID, COUNT(*) AS AccidentCount
FROM AccidentReports
GROUP BY RoadID
HAVING AccidentCount > 4;


-- Retrieve data for traffic light optimization
SELECT
    tl.LightID,
    tl.RoadID,
    tl.Location,
    tl.InstallDate,
    AVG(tf.VehicleCount) AS AvgVehicleCount,
    AVG(tf.AverageSpeed) AS AvgSpeed,
    COUNT(ar.ReportID) AS AccidentCount
FROM
    TrafficLights tl
LEFT JOIN
    TrafficFlow tf ON tl.RoadID = tf.RoadID
LEFT JOIN
    AccidentReports ar ON tl.RoadID = ar.RoadID
GROUP BY
    tl.LightID, tl.RoadID, tl.Location, tl.InstallDate
ORDER BY
    AvgVehicleCount DESC, AccidentCount ASC;

-- Retrieve Traffic Light Status
SELECT LightID, Location, InstallDate
FROM TrafficLights
WHERE RoadID = 'R001'; -- Specify the RoadID of the intersection


-- Get Current Traffic Flow
SELECT RoadName, AVG(VehicleCount) AS AvgVehicleCount
FROM TrafficFlow AS tf
JOIN Roads AS r ON tf.RoadID = r.RoadID
WHERE r.RoadID = 'R001' -- Specify the RoadID of the intersection
  AND DATE(tf.Date) = CURDATE()  -- Filter by the current date
  AND TIME(tf.Time) >= NOW() - INTERVAL 5 MINUTE
GROUP BY RoadName;


-- Control Traffic Lights (Assuming Fixed Timings)
-- Assuming you have a TrafficLightStatus column in the TrafficLights table
UPDATE TrafficLights
SET TrafficLightStatus =
    CASE
        WHEN TIME(NOW()) BETWEEN '08:00:00' AND '08:30:00' THEN 'Green'
        WHEN TIME(NOW()) BETWEEN '08:30:00' AND '08:35:00' THEN 'Yellow'
        ELSE 'Red'
    END
WHERE RoadID = 'R001'; -- Specify the RoadID of the intersection


-- Log Traffic Light Control
VALUES ('R001', 'Green', NOW()); -- Specify the RoadID and desired LightStatus

-- Retrieve Traffic Light Control History

SELECT RoadID, LightStatus, ControlTimestamp
FROM TrafficLightControl
WHERE RoadID = 'R001' -- Specify the RoadID of the intersection
ORDER BY ControlTimestamp DESC
LIMIT 10;

-- 1.	Traffic Pattern Analysis
SELECT
    RoadID,
    CONCAT(HOUR(Time), ':', MINUTE(Time)) AS TimeOfDay,
    AVG(VehicleCount) AS AvgVehicleCount
FROM TrafficFlow
WHERE
    TIME(Time) BETWEEN '06:00:00' AND '09:00:00' -- Define morning peak hours
GROUP BY RoadID, TimeOfDay;
SELECT
    RoadID,
    CONCAT(HOUR(Time), ':', MINUTE(Time)) AS TimeOfDay,
    AVG(VehicleCount) AS AvgVehicleCount
FROM TrafficFlow
WHERE
    TIME(Time) BETWEEN '16:00:00' AND '19:00:00' -- Define evening peak hours
GROUP BY RoadID, TimeOfDay;

-- Optimized query to retrieve data for traffic light optimization
SELECT
    tl.LightID,
    tl.RoadID,
    tl.Location,
    tl.InstallDate,
    AVG(tf.VehicleCount) AS AvgVehicleCount,
    AVG(tf.AverageSpeed) AS AvgSpeed,
    COUNT(ar.ReportID) AS AccidentCount
FROM
    TrafficLights tl
LEFT JOIN
    TrafficFlow tf ON tl.RoadID = tf.RoadID
LEFT JOIN
    AccidentReports ar ON tl.RoadID = ar.RoadID
GROUP BY
    tl.LightID, tl.RoadID, tl.Location, tl.InstallDate
ORDER BY
    AvgVehicleCount DESC, AccidentCount ASC;


